// 1. Get the AI Response
// We check for 'ai_response', 'text', or 'output' just to be safe
const inputItem = $input.first();
const aiText = inputItem.json.ai_response || inputItem.json.text || inputItem.json.output || "No text generated";

// 2. Get the School Name directly from the  on Form submission Node
// IMPORTANT: Ensure the name inside $('...') matches your first node's name EXACTLY
let schoolName = "Test";
try {
  // We look back at the "MCQ Form Trigger" node to get the name
  schoolName = $('MCQ Form Trigger').first().json.body.schoolName;
} catch (error) {
  // If that fails, we use a fallback
  schoolName = "Generated_Test";
}

const fileName = `${schoolName.replace(/ /g, "_")}_MCQ_Test.txt`;

// 3. Create the Binary Buffer
const binaryData = Buffer.from(aiText, 'utf8');

// 4. Return the file object
return {
  json: {
    success: true,
    fileName: fileName
  },
  binary: {
    data: { // The key 'data' is standard
      data: binaryData.toString('base64'),
      mimeType: 'text/plain',
      fileName: fileName
    }
  }
};
